-- =============================================
-- Author:      Vikesh Mewada
-- Description: Gets the device information
-- =============================================
CREATE PROCEDURE [dbo].[SSP_GetDeviceInfo]
(
    @DeviceId int
)
AS
BEGIN
    SELECT [Name]
		  ,[Image]
		  ,[Vendor]
		  ,[FWVersion]
	  FROM [DeviceInfo] 
	 WHERE [DeviceId]=@DeviceId
END
GO
