SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:      Vikesh Mewada
-- Description: Gets the device page information
-- =============================================
CREATE PROCEDURE [dbo].[SSP_GetDevicePageInfo]
(
    @DeviceId int
)
AS
BEGIN
	SELECT PI.[PageId]
		  ,PI.[PageId] + ': ' + [Name] AS ItemText
		  ,[IsSelected]
		  ,[ParentPageId]
	  FROM [DevicePageMapping] DPM LEFT JOIN
		   [PageInfo] PI ON DPM.PageId = PI.PageId
	 WHERE [DeviceId]=@DeviceId
	ORDER BY [PageOrder],[ParentPageId]
END
GO
