-- =============================================
-- Author:      Vikesh Mewada
-- Description: Gets the device Parameters
-- =============================================
CREATE PROCEDURE [dbo].[SSP_GetPageParams]
(
    @PageId nvarchar(4)
)
AS
BEGIN
	SELECT PI.[ParameterId]
		  ,[Name]
		  ,[Description]
		  ,[FieldType]
		  ,[MinValue]
		  ,[MaxValue]
		  ,[DefaultValue]
		  ,[Validation]
		  ,[IsReadOnly]
		  ,[Unit]
		  ,PPM.ParameterOrder
	  FROM [PageParameterMapping] PPM LEFT JOIN
		   [dbo].[ParameterInfo] PI ON PPM.ParameterId = PI.ParameterId
	 WHERE [PageId] = @PageId
	ORDER BY [ParameterOrder]
END
GO
